import React from 'react'

const Held = ({items}) => {
    console.log(items)
    const HeldItems = items.map((item, i) => {
        console.log(item)
        return (
            <div key={i}>
                {item.name}
            </div>
        )
    })

    return (
        <div>
            {HeldItems}
        </div>
    )

}

export default Held
